    $rootScope.filterArray = function (array, keys, values) {
      var result = [];
      if (array) {
        for (var i = 0; i < array.length; i++) {
          var matched = true;
          for (var j = 0; j < keys.length; j++) {
            if (array[i][keys[j]] !== values[j]) {
              matched = false;
              break;
            }
          }
          if (matched) {
            result.push(array[i]);
          }
        }
      }
      return result;
    };
    $rootScope.findObjectByKey = function (array, key, value) {
      if (array) {
        if (Array.isArray(key)) {
          for (var i = 0; i < array.length; i++) {
            var isMatch = true;
            angular.forEach(key, function (e, j) {
              isMatch = array[i][key[j]] == value[j];
            });
            if (isMatch) {
              return array[i];
            }
          }
        } else {
          for (var i = 0; i < array.length; i++) {
            if (array[i][key] == value) {
              return array[i];
            }
          }
        }
      }
      return null;
    };
    $rootScope.removeObjectByKey = function (array, key, value) {
      if (Array.isArray(key)) {
        for (var i = 0; i < array.length; i++) {
          var isMatch = true;
          angular.forEach(key, function (e, j) {
            isMatch = array[i][key[j]] == value[j];
          });
          if (isMatch) {
            array.splice(i, 1);
            break;
          }
        }
      } else {
        for (var i = 0; i < array.length; i++) {
          if (array[i][key] == value) {
            array.splice(i, 1);
            break;
          }
        }
      }
      for (var i = 0; i < array.length; i++) {
        if (array[i][key] == value) {
          array.splice(i, 1);
          break;
        }
      }
    };

